[bp~='container'] {
  width: 100%;
  margin: 0 auto;
  display: block;
  max-width: 1200px; }

[bp~='grid'] {
  display: grid !important;
  grid-gap: 20px;
  grid-template-columns: repeat(12, 1fr); }

[bp~='vertical-start'] {
  align-items: start; }

[bp~='vertical-center'] {
  align-items: center; }

[bp~='vertical-end'] {
  align-items: end; }

[bp~='between'] {
  justify-content: center; }

[bp~='gap-none'] {
  grid-gap: 0;
  margin-bottom: 0; }

[bp~='gap-column-none'] {
  grid-column-gap: 0; }

[bp~='gap-row-none'] {
  grid-row-gap: 0;
  margin-bottom: 0; }

[bp~='first'] {
  order: -1; }

[bp~='last'] {
  order: 12; }

[bp~='hide'] {
  display: none !important; }

[bp~='show'] {
  display: initial !important; }

[bp~='grid'][bp*='@'] {
  grid-template-columns: 12fr; }

[bp~='grid'][bp*='@sm'],
[bp~='grid'][bp*='@md'],
[bp~='grid'][bp*='@lg'],
[bp~='grid'][bp*='@xl'] {
  grid-template-columns: 12fr; }

